import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./ParkComponent.css";

class ParkComponent extends Component {
  constructor(props) {
    super(props);
    this.state = {
      name: "",
      ParkImages: [],
      parkCode: "",
      park: ""
    };
  }
  componentDidMount() {
    {
      fetch(
        "https://developer.nps.gov/api/v1/parks&api_key=y010UOulh2F9R7ahrlYpcyXUEJltY7vRei1uVxpe"
      )
        .then(res => {
          res.json();
          console.log(res);
        })
        .then(res =>
          this.setState({
            park: res.data[0],
            parkCode: res.data[0].parkCode,
            ParkImages: res.data[0].images,
            name: res.data[0].name
          })
        );
    }
  }
  render() {
    let AllParks = this.state.parks.map(park => {
      return (
        <div className="parkcomponent-container">
          <Link to={`park/${this.state.parkCode}`}>
            <p className="ParkName">{this.state.name}</p>
            <div className="ImageContainer">
              <div className="fade" />
              <img className="Image" src={this.state.ParkImages[0].url} />
            </div>
          </Link>
        </div>
      );
    });

    return <div className={AllParks} />;
  }
}
export default ParkComponent;
